snippet.description:
The last bits of a build are always the worst bits. If you’ve ever built anything intensive yourself, you know exactly what we mean. Wire this, plug that leak, weld that… ALL the stuff you forgot to do or left for later. Now’s the time to do it. Will Suppy get enough done in his AC-less garage to be able to fire the thing up and get it on the dyno finally?

Want a chance to win Zac’s Chevy C10 Chopper hauler? Check it out at www.hoonigan.com/giveaway for your chance to call it your own.

We’ve got channels for all your car content needs. Subscribe, nerds.

The Hoonigans: https://www.youtube.com/user/TheHoonigans?sub_confirmation=1

Project Cars: https://www.youtube.com/c/HooniganProjectCars??sub_confirmation=1

Daily Transmission: http://www.youtube.com/c/HooniganDailyTransmission?sub_confirmation=1

Ken Block: https://www.youtube.com/KenBlockHHIC?sub_confirmation=1

AutoFocus: https://www.youtube.com/channel/UCuGuOqcXsgzL3YrguODoGXw?sub_confirmation=1

Bonus: https://www.youtube.com/channel/UCFhUumuHyYL-mAXSeZVbqMg?sub_confirmation=1

Stay fresh with the latest apparel: https://www.hoonigan.com/thenewnew

Facebook: https://www.facebook.com/TheHoonigans/

Instagram: https://www.instagram.com/thehoonigans/

Follow Our Crew:
